import React from "react";
import styled from "styled-components";
import withImages from "next-images";

import NavbarComp from "../UI/NavbarComp";

import HeroCar from "../../public/static/images/landing/hero-car.png";

const Landing = () => {
  return (
    <Container>
      <NavbarComp />
      <HeroDiv className="hero-background">
        <div>
          <h3>
            Sam's
            <br /> Auto
          </h3>
        </div>
      </HeroDiv>
    </Container>
  );
};

export default Landing;

const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-color: #151515;
  font-family: "Quicksand", sans-serif;
  color: white;
`;
const HeroDiv = styled.div`
  width: 100vw;
  height: 424px;
  background: url("/static/images/landing/hero-normal.png") center center
    no-repeat;
  background-size: cover;
  div {
    background: rgba(67, 67, 67, 0.44);
    height: 40%;
    /* padding: 10vh 0; */
    transform: translate3d(0, 100%, 0);
  }
  h3 {
    text-align: center;
    transform: translate3d(0, 100%, 0);
    font-size: 52px;
  }
`;
